(113, 91, 0, 1, 0, 0, 'YSL Men&#039;s Clothing', 36, 782, 0, 0, 0, 0, 0, 0, 0, 1, 0, 1, 1, 20, 0, 1750576561, '', '{\"width\":400,\"height\":280}', '', 'YSL Men&#039;s Clothing', '', '\r\nRock-and-roll edge with Parisian polish. Leather jackets, tuxedo shirts, and slim-fit tailoring. For the nightlife aristocrat.', '', 0),
(114, 91, 0, 1, 0, 0, 'Loewe Men&#039;s Clothing', 50, 2933, 0, 0, 0, 0, 0, 0, 0, 1, 0, 1, 1, 20, 0, 1750576593, '', '{\"width\":400,\"height\":280}', '', 'Loewe Men&#039;s Clothing', 'Loewe Men&#039;s Clothing', '\r\nSpanish artisanship elevated. Anagram-embossed leather, fluid drapery, and experimental textures. A celebration of organic forms and quiet wealth.', '', 0),
(115, 91, 0, 1, 0, 0, 'Fendi Men&#039;s Clothing', 55, 3240, 0, 0, 0, 0, 0, 0, 0, 1, 0, 1, 1, 20, 0, 1750576606, '', '{\"width\":400,\"height\":280}', '', 'Fendi Men&#039;s Clothing', 'Fendi Men&#039;s Clothing', '\r\nRoman baroque splendor. FF logo sweaters, fur-trimmed parkas, and sculptural leather. Bold, eclectic, and unapologetically lavish.', '', 0),
(116, 91, 0, 1, 0, 0, 'Balenciaga Men&#039;s Clothing', 64, 3098, 0, 0, 0, 0, 0, 0, 0, 1, 0, 1, 1, 20, 0, 1750576617, '', '{\"width\":400,\"height\":280}', '', 'Balenciaga Men&#039;s Clothing', 'Balenciaga Men&#039;s Clothing', '\r\nDeconstructed glamour. Oversized silhouettes, glossy tracksuits, and sock sneakers. A dystopian take on luxury for the post-modern rebel.', '', 0),
(117, 91, 0, 1, 0, 0, 'Prada Men&#039;s Clothing', 43, 4368, 0, 0, 0, 0, 0, 0, 0, 1, 0, 1, 1, 20, 0, 1750576630, '', '{\"width\":400,\"height\":280}', '', 'Prada Men&#039;s Clothing', 'Prada Men&#039;s Clothing', '\r\nIntellectual minimalism meets nylon innovation. Saffiano leather bags, geometric knits, and anarchy-inspired graphics. For the avant-garde professional.', '', 0),
(118, 91, 0, 1, 0, 0, 'Hermès Men&#039;s Clothing', 52, 2212, 0, 0, 0, 0, 0, 0, 0, 1, 0, 1, 1, 20, 0, 1750576643, '', '{\"width\":400,\"height\":280}', '', 'Hermès Men&#039;s Clothing', 'Hermès Men&#039;s Clothing', '\r\nUltimate craftsmanship in leather, cashmere, and silk. Timeless polo shirts, H-logo belts, and bespoke tailoring. For the discerning heir of quiet opulence.', '', 0),
